$('.your-class-name'); //Note we are using the $ here. This jQuery object will perform operations on all of the elemetns that have the class "your-class-name"

jQuery('.a-different-class-name'); //This jQuery object will perform all actions on "a-different-class-name". These actions will be perfromed in the same way they will be on the first line as there is no difference between using "$" and "jQuery".